    "gjs-html": "<body><meta charset=\"utf-8\"/><meta name=\"viewport\" content=\"width=device-width, initial-scale=1\"/><title>Geppetto Group</title><base href=\"/\"/><link rel=\"stylesheet\" type=\"text/css\" href=\"https://fonts.googleapis.com/css?family=Open+Sans|Candal|Alegreya+Sans\"/><link rel=\"stylesheet\" href=\"https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css\"/><link rel=\"stylesheet\" type=\"text/css\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.5.0/css/font-awesome.css\"/><link rel=\"stylesheet\" type=\"text/css\" href=\"./assets/css/imagehover.min.css\"/><div class=\"banner\"><div class=\"bg-color\"><div class=\"container\"><div class=\"row\"><div class=\"banner-text text-center\"><div class=\"text-border\"><h2 class=\"text-dec\">Get banking and financial investment services including internet mobile banking\n              accounts, loans, money transfers and nri services online at GEPPETTO</h2></div><div class=\"intro-para text-center quote\"><p class=\"big-text\">GEPPETTO</p><a href=\"#\" class=\"btn get-quote\">Read\n              More</a></div><a href=\"#\" class=\"mouse-hover\"><div class=\"mouse\"></div></a></div></div></div></div></div><section id=\"feature\" class=\"section-padding\"><div class=\"container\"><div class=\"row content\"><div class=\"header-section text-center\"><h2>How we do business </h2><hr class=\"bottom-line\"/></div><div class=\"feature-info\"><div class=\"fea\"><div class=\"col-md-4\"><div class=\"card-body d-flex flex-column justify-content-between\"><p class=\"card-text\">We have provided 28.5 billion US dollars in sustainable financing and investments\n                since 2017.\n                Sustainable financing and investments provided since 2017</p></div></div></div><div class=\"fea\"><div class=\"col-md-4\"><div class=\"card-body d-flex flex-column justify-content-between\"><p class=\"card-text\">49\n                PER CENT\n                The proportion of employees worldwide who work flexibly is 49 per cent.\n                The proportion of employees worldwide who work flexibly</p></div></div></div><div class=\"fea\"><div class=\"col-md-4\"><div class=\"card-body d-flex flex-column justify-content-between\"><p class=\"card-text\">658m\n                PER MONTH\n                We screen more than 658 million transactions per month for money laundering and financial crime.\n                The number of transactions we screen for money laundering and financial crime</p></div></div></div></div></div></div></section><section id=\"faculity-member\" class=\"section-padding\"><div class=\"container\"><div class=\"row content\"><div class=\"header-section text-center\"><h2>Our approach</h2><hr class=\"bottom-line\"/></div><div class=\"col-lg-4 col-md-4 col-sm-4\"><div class=\"pm-staff-profile-container\"><div class=\"pm-staff-profile-image-wrapper text-center\"><div class=\"pm-staff-profile-image\"><img src=\"./assets/img/achivement.jpg\" alt=\"\" class=\"img-thumbnail img-circle circle-image\"/></div></div><div class=\"pm-staff-profile-details text-center\"><p class=\"pm-staff-profile-name\">My Achieve</p><p class=\"pm-staff-profile-title\">Endless possibilities, diverse outlooks. Build your career at GEPPETTO.</p></div></div></div><div class=\"col-lg-4 col-md-4 col-sm-4\"><div class=\"pm-staff-profile-container\"><div class=\"pm-staff-profile-image-wrapper text-center\"><div class=\"pm-staff-profile-image\"><img src=\"./assets/img/students.jpg\" alt=\"\" class=\"img-thumbnail img-circle circle-image\"/></div></div><div class=\"pm-staff-profile-details text-center\"><p class=\"pm-staff-profile-name\">Students\n            </p><p class=\"pm-staff-profile-title\">From our UK apprenticeship schemes to graduate programmes around the\n              world, we offer many opportunities for people at the start of their career.</p></div></div></div><div class=\"col-lg-4 col-md-4 col-sm-4\"><div class=\"pm-staff-profile-container\"><div class=\"pm-staff-profile-image-wrapper text-center\"><div class=\"pm-staff-profile-image\"><img src=\"./assets/img/course01.jpg\" alt=\"\" class=\"img-thumbnail image-circle img-circle circle-image\"/></div></div><div class=\"pm-staff-profile-details text-center\"><p class=\"pm-staff-profile-name\">GEPPETTO</p><p class=\"pm-staff-profile-title\">We aim to create an environment where everyone can achieve their full\n              potential, regardless of their background.</p></div></div></div></div></div></section><footer id=\"footer\" class=\"footer\"><div class=\"container text-center\"><ul class=\"social-links\"><li><a href=\"#link\"><i class=\"fa fa-twitter fa-fw\"></i></a></li><li><a href=\"#link\"><i class=\"fa fa-facebook fa-fw\"></i></a></li><li><a href=\"#link\"><i class=\"fa fa-google-plus fa-fw\"></i></a></li><li><a href=\"#link\"><i class=\"fa fa-dribbble fa-fw\"></i></a></li><li><a href=\"#link\"><i class=\"fa fa-linkedin fa-fw\"></i></a></li></ul>\n    ©2019 GEPPETTO Group 2019 . All rights reserved\n    <div class=\"credits\">\n      Designed by <a href=\"#\">GEPPETTO</a></div></div></footer></body>",
